import Settings from './Settings';
import * as React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
    return (
        <BrowserRouter>
        <div className="header">
            <h1>Art Supplies</h1>

            <div>
                <Settings />
            </div>

            <nav>
                <ul className="navbar">
                    <li>
                        <NavLink to="/brushes" />
                    </li>

                </ul>
            </nav>

        </div>
</BrowserRouter>
    )
}

export default Header;
